import React, { useState } from 'react';

class App extends React.Component {
    arrList = [1, 2, 3, 4];
    render() {
        return (
            <div className='test'>
                {
                    this.arrList.forEach(list => {
                        return (<p>{list}</p>);
                    })
                }
            </div>
        );
    }
}

export default App;
